                  Finish Vacuum Buying Guide Dyson V11 Torque Drive Nickel And
                  Blue Cordless Vacuum - 268731-01 Intelligently optimizes
                  suction and run time. Deep cleans everywhere. Features:
                  Features Powerful cleaning on floors and carpets An integrated
                  digital motor spins the brush bar up to 60 times a second. It
                  drives stiff nylon bristles deep into carpet to remove dirt,
                  and carbon fiber filaments capture fine dust on hard floors.
                  Dyson technology helps create a cleaner, healthier home Our
                  vacuums and purifiers are scientifically proven to capture
                  particles as small as allergens and bacteria. Intelligently
                  reports in real time Monitors system performance 8,000 times a
                  second, then reports in real time on the LCD screen. The right
                  cleaning mode for the right task Three cleaning modes
                  optimized for a variety of tasks. The right balance of power
                  and run time, where you need it. Integrated power management
                  system Dyson's battery technology and battery-saving trigger
                  help to provide our longest run time by only using power when
                  you need it. 'Point and shoot' hygienic bin emptying The
                  'point and shoot' mechanism hygienically ejects dust and
                  debris deep into your bin, in one action – so there's no need
                  to touch the dirt. Drop-in docking The Dyson V11™ vacuum drops
                  into the wall-mounted dock, to charge it and tidily store
                  tools. So it's ready to grab and go. Technology Powered by the
                  Dyson digital motor V11 Twice the suction of any cord-free
                  vacuum. Tested at the cleaner head to ASTM F558, dust loaded.
                  Fade-free power The seven-cell nickel-cobalt-aluminum battery
                  has the fade-free power to clean here, there and everywhere
                  around your home. 14 cyclones 14 cyclones generate forces of
                  more than 79,000g to fling microscopic particles – such as
                  pollen and bacteria – into the bin. Whole-machine filtration
                  The fully-sealed filtration system traps 99.97% of particles
                  as small as 0.3 microns – expelling cleaner air. Acoustically
                  engineered Designed to absorb vibrations and dampen noise, to
                  keep sound levels down. In-line configuration The motor, bin
                  and cyclone are aligned, so air is drawn into the cyclones in
                  a straight line – helping to create powerful Dyson suction.
                  Specifications: Cleaner head: Nickel Torque Drive Cyclone
                  technology: 14 concentric cyclones Filtration: Advanced
                  whole-machine filtration Charge time: 4.5 hrs Bin volume: 0.2
                  gallon Run time: Up to 60** mins In the Box: Dyson V11 Torque
                  Drive (Nickel/Blue) Nickel Torque Drive Mini Motorized tool
                  Combination tool Crevice tool Mini soft dusting brush Stubborn
